import styled from "styled-components";
import { motion } from "framer-motion";

const SearchComponentStyle = styled(motion.div)`
  margin-top: 10vw;
  position: relative;
  display: flex;
  flex-direction: column;
  margin-left: 5vw;
  background-color: black;
  width: 90vw;
  .searchBar {
    display: flex;
    padding: 2vw;
    background-color: beige;
    width: 50vw;
    .icon {
      height: 50px;
      width: 50px;
      max-height: 50px;
      max-width: 50px;
      background-color: aqua;
      margin-right: 3vw;
    }
  }
  .suggest {
    height: auto;
    width: 50vw;
  }
`;

const variants = {
  visible: (custom) => ({
    opacity: [0, 1],
    transition: { delay: custom / 5, duration: 0.5 },
  }),
};

const SearchComponent = () => {
  return (
    <SearchComponentStyle>
      <div className="searchBar">
        <div className="icon" />
        <input />
      </div>
      <div className="suggest">
        <motion.span custom={1} animate="visible" variants={variants}>
          travel <span> 201 article </span>
        </motion.span>
        <motion.span custom={2} animate="visible" variants={variants}>
          media <span> 21 article </span>
        </motion.span>
        <motion.span custom={3} animate="visible" variants={variants}>
          travel <span> 150 article </span>
        </motion.span>
      </div>
    </SearchComponentStyle>
  );
};
export default SearchComponent;
